import { useState, useEffect } from 'react'
import BabyService from './services/baby'

function App() {
  const [ babyList, setBabyList ] = useState([])
  useEffect(()=>{
    const getList = async()=>{
      const list = await BabyService.getBabyList()
      setBabyList(list)
      console.log('list', list.babies)
    }
    getList()
  },[])

  return (
    <div>
      {babyList[0]?.first_name}
    </div>
  );
}

export default App;
